//New Login


import './Component.css';
import React, {useState, useEffect} from 'react'
import {Link, useHistory, useParams } from 'react-router-dom';
import EmployeeService from '../services/EmployeeService'



const Login = () => {

const [employeeCode, setEmployeeCode] = useState('');
const [password, setPassword] = useState('');
const [genRoute,setGenRoute]=useState('');
const employee={employeeCode,password};

const HandleSubmit=(e)=>
{

e.preventDefault();
const adminRoute="/employees";
const employeeRoute="/view-employee/";
EmployeeService.login(employee).then((response) => {

    if (response.status===200)
        console.log(response.data.position);

    console.log("Logged in by : "+response.data.position);
    if(response.data.position==="Admin")
        setGenRoute(adminRoute)
    else
    setGenRoute(employeeRoute)
    

}).catch(error => {
    console.log(error);
});
}

return (
    <>
    <form>   
    <div id="main" class="container d-flex justify-content-center align-items-center">
    
     <div class="row mb-3">
 
         <label class="col-sm-4" class="form-control-sm form-label">EmployeeCode</label>
         <input class="col-sm-6" class="form-control-sm form-input"  
         type="text"
 
         value={employeeCode}
 
         onChange={(e) => setEmployeeCode(e.target.value)}  />
     
     </div>
     <div class="row mb-3">
         <label class="col-sm-4" class="form-control-sm form-label">Your Email ID</label>
         <input class="col-sm-6" class="form-control-sm form-input" 
     type="password"
 
     value={password}
 
     onChange={(e) => setPassword(e.target.value)}
 
     />
     </div>
     
     <div class="mt-3" >
     <Link className="btn btn-info" onClick={(e)=>HandleSubmit(e)} to={``} >Submit</Link>
     
     </div>
 </div>
 </form>  
 </>

);

};

export default Login;
